import React from "react";
import { useState } from "react";

function Home() {
  const [houses, setHouses] = useState([]);
  async function getHouses() {
    try {
      let res = await fetch("http://localhost:9292/houses");
      let obj = await res.json();
      // console.log(obj)
      setHouses(obj);
    } catch (error) {
      console.log(error);
    }
  }

  return (
    <>
      <div classNameName="home">
        <div classNameName="card bg-dark text-white border-0">
          <img
            src="https://i.pinimg.com/736x/4a/a8/f5/4aa8f5d237daabb1ceec9aa3a3931bad.jpg"
            classNameName="card-img"
            alt="Background"
            height="700px"
            width="90%"
          />
          <div classNameName="card-img-overlay d-flex flex-column justify-content-center">
            <div classNameName="container">
              <h5 classNameName="card-title  display-3 fw-bolder mb-0">
                {" "}
                <header classNameName="masthead">
                  <div classNameName="container px-4 px-lg-5 h-100">
                    <div classNameName="row gx-4 gx-lg-5 h-100 align-items-center justify-content-center text-center">
                      <div classNameName="col-lg-10 align-self-end">
                        <h1 classNameName="font-weight-bold">
                          <span>🏠</span>WELCOME TO OUR HOMES<span>🏠</span>
                        </h1>
                        <hr classNameName="divider" />
                      </div>
                      <div classNameName="col-lg-8 align-self-baseline">
                        <p classNameName="text-white-75 mb-5">
                          "When one door closes,buy another one and open it
                          yourself 🔑 "
                        </p>
                        <div classNameName="dropdown">
                          <button
                            onClick={getHouses}
                            classNameName="btn btn-primary"
                            type="button"
                          >
                            Gallery
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>
                </header>
              </h5>
            </div>
          </div>
        </div>
      </div>
      {houses.length === 0
        ? console.log("no houses found")
        : houses.map((house) => (

            <div className="row">
              <div className="col-sm-6">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">{house.type_of_house}</h5>
                    <img className="card-text">image:{house.image_url}</img>
                    <a href="#" className="btn btn-primary">

                    </a>
                  </div>
                </div>
              </div>
              <div className="col-sm-6">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Location:{house.location}</h5>
                    <p className="card-text">
                   number_of_rooms: {house.number_of_rooms}<br/>
                    View Day: {house.view_day}
                    </p>
                    <a href="#" className="btn btn-primary">
                      click to buy
                    </a>
                  </div>
                </div>
              </div>
            </div>

            // <div key={house.id} classNameName="card mb-3">
            //   <h3 classNameName="card-header">{house.type_of_house}</h3>
            //   <div classNameName="card-body">
            //     <h5 classNameName="card-title">{house.location}</h5>
            //   </div>
            //   <svg
            //     xmlns={house.image_url}
